import { Player } from 'video-react';

function VideoPlayer(props) {
  return (
    <div className="App">
      <Player
        muted={true}
        autoPlay={true}
        playsInline
        poster="/assets/poster.png"
        src="https://media.w3.org/2010/05/sintel/trailer_hd.mp4"
        controls={false}
        {...props}
      />
    </div>
  );
}

export default VideoPlayer;
